import React from 'react';
import Button from './Button';

const ModalContent = ({ title, items = []}) => {
   console.log(items)
    return (
        <div>
            <h3>{title}</h3>
            <div>
                {items.length !== [] ? (

                items !== undefined && items.map((item, id) => {
                        return(
                        <div key={id}>
                            <div>
                            <h5>{item.name}</h5>
                            </div> 

                        </div>

                        )
                }
                )
                ) 

                :
                     <Button />
                }

            </div>



        </div>
    );
}

export default ModalContent;
